import React from 'react';
import logo from './img/logo.png';

const Optowelt = () => {
    return (
        <div>
            <div><img src={logo} className="" width="500" height="500" alt={"logo"}/> </div>
           <h1> Optowelt</h1>
        </div>
    );
};

export default Optowelt;
